    false,nt"url": null,nt"notes": "This database contains information on individual
    sea lions that were marked or handled from 1985-2014.  Individuals were handled
    for various projects including vital rate, telemetry and morphometric studies. Many
    of the animals were either flipper tagged or branded. Captures techniques vary including;
    hand-capture of  pups, hoop netting and underwater captures of juveniles, dart-delivered
    sedation of adult females, and floating pen capture of sub-adult and adult males.",nt"license_title":
